function object_mapper.GetModelFromHash(hash) -- only model_names contains objects that can be streamed anywhere. The other lists have primarily objects that are only streamable in certain areas.
	return model_names[hash] or more_objects[hash] or unfiltered_models[hash] or "unknown_object_name" -- Haven't found an object that isn't in the lists as of gta 1.61, 14.08.2022
end

local object_hashes <const> = {}
for hash in pairs(model_names) do
	object_hashes[#object_hashes + 1] = hash
end

function object_mapper.get_random_object()
	local hash
	repeat
		hash = object_hashes[math.random(1, #object_hashes)]
	until streaming.is_model_valid(hash)
	return hash
end

function object_mapper.get_hash_from_user_input(...)
	local user_input = ...
	if user_input == "?" then
		return object_mapper.get_random_object()
	end
	user_input = user_input:lower()
	if model_names[gameplay.get_hash_key(user_input)] then
		return gameplay.get_hash_key(user_input)
	end
	for hash, Model in pairs(model_names) do
		if Model:find(user_input, 1, true) and streaming.is_model_valid(hash) then
			return hash
		end
	end
	return 0
end

return object_mapper